const Stack = createNativeStackNavigator();
import * as React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { useFonts } from "expo-font";
import Account from "./screens/Account";
import Landing from "./screens/Landing";
import Inbox from "./screens/Inbox";
import Inbox1 from "./screens/Inbox1";
import VirtualClassroom from "./screens/VirtualClassroom";
import Groups from "./screens/Groups";
import Clubs from "./screens/Clubs";
import CreateClub from "./screens/CreateClub";
import CreateGroup from "./screens/CreateGroup";
import CreatePost from "./screens/CreatePost";
import Post from "./screens/Post";
import Feed from "./screens/Feed";
import HomeActive from "./components/HomeActive";
import HomeInactive from "./components/HomeInactive";
import IconsaxLinearprofile2user1 from "./components/IconsaxLinearprofile2user1";
import IconsaxLinearprofile2user from "./components/IconsaxLinearprofile2user";
import IconsaxLinearmonitormobbile1 from "./components/IconsaxLinearmonitormobbile1";
import IconsaxLinearmonitormobbile from "./components/IconsaxLinearmonitormobbile";
import IconsaxLinearmessage1 from "./components/IconsaxLinearmessage1";
import IconsaxLinearmessage from "./components/IconsaxLinearmessage";
import WhatsAppImage20230122At5Icon1 from "./components/WhatsAppImage20230122At52411";
import WhatsAppImage20230122At5Icon from "./components/WhatsAppImage20230122At5241";

import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { View, Text, Pressable, TouchableOpacity } from "react-native";

import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";

const Tab = createBottomTabNavigator();
function BottomTabsRoot({ navigation }) {
  const [bottomTabItemsNormal] = React.useState([
    <HomeInactive />,
    <IconsaxLinearprofile2user />,
    <IconsaxLinearmonitormobbile />,
    <IconsaxLinearmessage />,
    <WhatsAppImage20230122At5Icon />,
  ]);
  const [bottomTabItemsActive] = React.useState([
    <HomeActive />,
    <IconsaxLinearprofile2user1 />,
    <IconsaxLinearmonitormobbile1 />,
    <IconsaxLinearmessage1 />,
    <WhatsAppImage20230122At5Icon1 />,
  ]);
  return (
    <Tab.Navigator
      screenOptions={{ headerShown: false }}
      tabBar={({ state, descriptors, navigation }) => {
        const activeIndex = state.index;
        return (
          <View
            style={{
              backgroundColor: 'white',
              justifyContent: 'space-between',
              flexDirection: "row",
              paddingHorizontal: 28,
              paddingVertical: 15,

            }}
          >
            {bottomTabItemsNormal.map((item, index) => {
              const isFocused = state.index === index;
              return (
                <Pressable
                  key={index}
                  onPress={() => {
                    navigation.navigate({
                      name: state.routes[index].name,
                      merge: true,
                    });
                  }}
                >
                  {activeIndex === index
                    ? bottomTabItemsActive[index] || item
                    : item}
                </Pressable>
              );
            })}
          </View>
        );
      }}
    >
      <Tab.Screen
        name="Feed"
        component={Feed}
        options={{ headerShown: false }}
      />
      <Tab.Screen
        name="Clubs"
        component={Clubs}
        options={{ headerShown: false }}
      />
      <Tab.Screen
        name="VirtualClassroom"
        component={VirtualClassroom}
        options={{ headerShown: false }}
      />
      <Tab.Screen
        name="Inbox"
        component={Inbox}
        options={{ headerShown: false }}
      />
      {/* <Tab.Screen
        name="Account"
        component={Account}
        options={{ headerShown: false }}
      /> */}
    </Tab.Navigator>
  );
}

const App = () => {
  const [hideSplashScreen, setHideSplashScreen] = React.useState(true);
  return (
    <>
      <NavigationContainer>
        {hideSplashScreen ? (
          <Stack.Navigator initialRouteName="Landing"screenOptions={{ headerShown: false }} >
            <Stack.Screen name="BottomTabsRoot" component={BottomTabsRoot} />
            <Stack.Screen name="Landing" component={Landing} options={{ headerShown: false }}/>
            <Stack.Screen name="Inbox1" component={Inbox1}  options={{ headerShown: false }} />
            <Stack.Screen name="Groups" component={Groups} options={{ headerShown: false }} />
            <Stack.Screen name="CreateClub" component={CreateClub} options={{ headerShown: false }} />
            <Stack.Screen name="CreateGroup" component={CreateGroup} options={{ headerShown: false }} />
            <Stack.Screen name="CreatePost" component={CreatePost} options={{ headerShown: false }} />
            <Stack.Screen name="Post" component={Post} options={{ headerShown: false }} />
          </Stack.Navigator>
        ) : null}
      </NavigationContainer>
    </>
  );
};
export default App;
